let drawWidth = 320;
let drawHeight = 320;
let canvas;
let drawStatus = false;
let paint;
let color = "black";
let width = 36;
let waitTimer = null;
$(() => {
  init()
  drawMonitor()
})

function init() {
  for(let i = 0; i < $('.statisticalChartItem').length; i++) {
    setTimeout(() => {
      $($('.statisticalChartItem')[i]).addClass('predictActive')
    }, 100*i)
  }
  setTimeout(() => {
    for(let i = ('.statisticalChartItem').length - 1; i >= 0; i--) {
      setTimeout(() => {
        $($('.statisticalChartItem')[i]).removeClass('predictActive')
      }, 100*i)
    }
  }, 1000)

  canvas = $('#drawCanvas')[ 0 ];
  canvas.width = drawWidth;
  canvas.height = drawHeight;
  paint = canvas.getContext("2d");
  //背景色
  paint.fillStyle = "#fff";
  paint.fillRect(0, 0, drawWidth, drawHeight);
  $('.clear').on('click', () => {
    init()
  })
}

//每次手离开 向算法里推送本次绘图
function stackImgs() {
  waitTimer = setTimeout(() => {
    let mycanvas = document.getElementById("drawCanvas");
    let predictCanvas = document.createElement('canvas');
    predictCanvas.width = 32
    predictCanvas.height = 32
    let ctx = predictCanvas.getContext('2d');
    ctx.drawImage(mycanvas, 0, 0, 32, 32)
    ctx.scale(0.1, 0.1)
    let predictImageData = ctx.getImageData(0, 0, 32, 32)
    // console.log(predictImageData)
    // 将预测数据色值 R 取出，色值除以 255，得到新的 ArrayBuffer
    const predictImageBuffer =
      new ArrayBuffer(predictImageData.width * predictImageData.height);
    for(let i = 0; i < predictImageData.data.length / 4; i++) {
      predictImageBuffer[i] = predictImageData.data[4*i] / 255 === 1 ? 0 : 1;
    }
   let predictResult = classifyFunc(predictImageBuffer, dataSet, 'x', 'y', 15, euclidean)
    console.log(predictResult)
    $($('.statisticalChartItem')[predictResult.result]).addClass('predictActive')
  }, 1000)

}

let startX, startY;

function drawMonitor() {
  //给画笔添加上个事件一个点击开始 ， 点击后移动 ，点击事件结束
  $(canvas).on("mousedown mousemove mouseup", function ( event ) {
    let endX;
    let endY;
    switch ( event.type ) {
      case "mousedown":
        // 开启绘画状态
        // console.log(event)
        drawStatus = true;
        //记录触屏的第一个点
        startX = event.offsetX;
        startY = event.offsetY;
        // 清空笔画计时器
        clearTimeout(waitTimer);
        break;
      case "mousemove":
        if ( drawStatus ) {
          // console.log(event)
          event.preventDefault();
          endX = event.offsetX;
          endY = event.offsetY;

          //画下线段
          paint.beginPath();
          paint.lineJoin = 'round';
          paint.lineCap = 'round';
          paint.moveTo(startX, startY);
          paint.lineTo(endX, endY);
          paint.strokeStyle = color;
          paint.lineWidth = width;
          paint.stroke();
          paint.closePath();

          startX = endX;
          startY = endY;
        }
        break;
      //手离开触屏是橡皮檫隐藏
      case "mouseup":
        // console.log(event)
        // 关闭绘画状态
        drawStatus = false;
        stackImgs();
        break;
    }
  });
}

function euclidean( a, b ) {
  // a,b  为两个相同维数一维数组
  let temp = 0;
  let distence = 0;
  for ( let index = 0; index < b.length; index++ ) {
    let x = Number(a[ index ]);
    let y = Number(b[ index ]);
    if ( index !== ( b.length - 1 ) ) {
      temp += ( x - y ) ** 2;
    } else {
      distence = Math.sqrt(temp + ( x - y ) ** 2);
    }
  }
  return distence;
}
/*
* @desc 决策
* @param  {Object} current 输入值
* @param  {Object} points 训练样本集
* @param  {Object} labelX 用于分类的输入值
* @param  {Object} labelY 用于分类的输出值
* @param  {Number} k 用于选择最近邻的数目
* @param  {Function} c 自定义比较函数
* @return {Object}
*/
function classifyFunc(current, points, labelX, labelY, k, c) {
  let result = [];
  let knn = getKnn(current, points, labelX, labelY, k, c);
  let dists = knn.dists;
  for (let i of knn.classify) {
    result.push({
      label: i,
      value: 0
    });
  }
  dists.map(function (item) {
    for (let i of result) {
      if (i.label === item.oriData[labelY]) {
        i.value++;
        break;
      }
    }
  });
  result.sort(function (a, b) {
    return b.value - a.value;
  });
  return { result: Number(result[0].label), resultArr: result,dists: dists };
}

/*
* @desc Knn算法
*/
function getKnn(current, points, labelX, labelY, k, c) {
  let dists = [];//存放最接近的
  let classify = [];//分类标识
  points.map(function (item) {
    if (classify.indexOf(item[labelY]) < 0) classify.push(item[labelY]);
    let result = {};
    result.oriData = item;
    let lableArrItem = item[labelX].split('');
    result.distance = c(current, lableArrItem) ;
    dists.push(result);
  });
  dists.sort(function (a, b) {//排序
    return a.distance - b.distance;
  });
  return { dists: dists.slice(0, k), classify: classify };
}

